import React, { useState, useEffect } from 'react';
import ApiService from '../../services/api';

const SubscriptionManagement = () => {
  const [activeTab, setActiveTab] = useState('overview');
  const [selectedFilter, setSelectedFilter] = useState('all');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  // Data states
  const [subscriptionPlans, setSubscriptionPlans] = useState([]);
  const [subscriptionStats, setSubscriptionStats] = useState([]);
  const [subscribers, setSubscribers] = useState([]);
  const [billingHistory, setBillingHistory] = useState([]);

  // Modal states
  const [showCreateModal, setShowCreateModal] = useState(false);
  const [showEditModal, setShowEditModal] = useState(false);
  const [showFeaturesModal, setShowFeaturesModal] = useState(false);
  const [showAddBillingModal, setShowAddBillingModal] = useState(false);
  const [selectedPlan, setSelectedPlan] = useState(null);

  // Form states
  const [planForm, setPlanForm] = useState({
    name: '',
    slug: '',
    description: '',
    monthly_price: '',
    yearly_price: '',
    setup_fee: '',
    max_properties: '',
    max_images_per_property: '',
    analytics_enabled: false,
    priority_support: false,
    api_access: false,
    custom_branding: false,
    advanced_reporting: false,
    is_active: true,
    is_featured: false,
    sort_order: 0,
    trial_days: 0
  });

  // Billing form state
  const [billingForm, setBillingForm] = useState({
    customer_name: '',
    email: '',
    plan_name: '',
    amount: '',
    billing_date: '',
    payment_method: 'Credit Card',
    status: 'pending',
    invoice_number: ''
  });

  // Load subscription plans and data
  useEffect(() => {
    fetchSubscriptionPlans();
    fetchSubscriptionStats();
  }, []);

  const fetchSubscriptionPlans = async () => {
    try {
      setLoading(true);
      const response = await ApiService.getAdminSubscriptionPlans();
      setSubscriptionPlans(response.data || response || []);
    } catch (error) {
      console.error('Error fetching subscription plans:', error);
      setError('Failed to load subscription plans');
    } finally {
      setLoading(false);
    }
  };

  const fetchSubscriptionStats = async () => {
    try {
      const response = await ApiService.getAdminSubscriptionStats();
      const stats = response.data || response || {};
      setSubscriptionStats([
        { title: 'Total Subscribers', value: String(stats.total_subscribers || 0), change: '+0%', icon: 'ðŸ‘¥', color: 'text-black' },
        { title: 'Active Subscriptions', value: String(stats.active_subscriptions || 0), change: '+0%', icon: 'âœ…', color: 'text-black' },
        { title: 'Monthly Revenue', value: `â‚±${(stats.monthly_revenue || 0).toLocaleString()}`, change: '+0%', icon: 'ðŸ’°', color: 'text-black' },
        { title: 'Pending Renewals', value: String(stats.pending_renewals || 0), change: '+0%', icon: 'â°', color: 'text-black' }
      ]);
    } catch (error) {
      console.error('Error fetching subscription stats:', error);
    }
  };

  // Fetch functions for new tabs
  const fetchSubscribers = async () => {
    try {
      const response = await ApiService.getAdminSubscribers();
      setSubscribers(response.data || []);
    } catch (error) {
      console.error('Error fetching subscribers:', error);
    }
  };

  const fetchBillingHistory = async () => {
    try {
      const response = await ApiService.getAdminBillingHistory();
      setBillingHistory(response.data || []);
    } catch (error) {
      console.error('Error fetching billing history:', error);
    }
  };

  // Load data based on active tab
  useEffect(() => {
    if (activeTab === 'subscribers') {
      fetchSubscribers();
    } else if (activeTab === 'billing') {
      fetchBillingHistory();
    }
  }, [activeTab]);

  // Form handlers
  const handleInputChange = (e) => {
    const { name, value, type, checked } = e.target;
    setPlanForm(prev => ({
      ...prev,
      [name]: type === 'checkbox' ? checked : value
    }));
  };

  const handleBillingInputChange = (e) => {
    const { name, value } = e.target;
    setBillingForm(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const resetForm = () => {
    setPlanForm({
      name: '',
      slug: '',
      description: '',
      monthly_price: '',
      yearly_price: '',
      setup_fee: '',
      max_properties: '',
      max_images_per_property: '',
      analytics_enabled: false,
      priority_support: false,
      api_access: false,
      custom_branding: false,
      advanced_reporting: false,
      is_active: true,
      is_featured: false,
      sort_order: 0,
      trial_days: 0
    });
    setSelectedPlan(null);
    setError('');
    setSuccess('');
  };

  const resetBillingForm = () => {
    setBillingForm({
      customer_name: '',
      email: '',
      plan_name: '',
      amount: '',
      billing_date: '',
      payment_method: 'Credit Card',
      status: 'pending',
      invoice_number: ''
    });
    setError('');
    setSuccess('');
  };

  const handleAddBilling = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      setError('');

      // Generate invoice number if not provided
      const invoiceNumber = billingForm.invoice_number || 
        `INV-${Date.now()}-${Math.random().toString(36).substr(2, 5).toUpperCase()}`;

      const newBilling = {
        ...billingForm,
        invoice_number: invoiceNumber,
        id: `bill_${Date.now()}`,
        billing_date: billingForm.billing_date || new Date().toISOString()
      };

      // Add to local state (in real app, this would be an API call)
      setBillingHistory(prev => [newBilling, ...prev]);

      setSuccess('Billing entry added successfully!');
      setShowAddBillingModal(false);
      resetBillingForm();

      // Auto-dismiss success message
      setTimeout(() => setSuccess(''), 3000);
    } catch (error) {
      setError(error.message || 'Failed to add billing entry');
      setTimeout(() => setError(''), 5000);
    } finally {
      setLoading(false);
    }
  };

  // CRUD Operations
  const handleCreatePlan = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      setError('');

      const response = await ApiService.createSubscriptionPlan(planForm);

      // If we get here without throwing, it was successful
      setSuccess('Subscription plan created successfully!');
      setShowCreateModal(false);
      resetForm();
      fetchSubscriptionPlans();
      fetchSubscriptionStats();

      // Auto-dismiss success message
      setTimeout(() => setSuccess(''), 3000);
    } catch (error) {
      setError(error.message || 'Failed to create subscription plan');
      // Auto-dismiss error message
      setTimeout(() => setError(''), 5000);
    } finally {
      setLoading(false);
    }
  };

  const handleEditPlan = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      setError('');

      const response = await ApiService.updateSubscriptionPlan(selectedPlan.id, planForm);

      // If we get here without throwing, it was successful
      setSuccess('Subscription plan updated successfully!');
      setShowEditModal(false);
      resetForm();
      fetchSubscriptionPlans();
      fetchSubscriptionStats();

      // Auto-dismiss success message
      setTimeout(() => setSuccess(''), 3000);
    } catch (error) {
      setError(error.message || 'Failed to update subscription plan');
      // Auto-dismiss error message
      setTimeout(() => setError(''), 5000);
    } finally {
      setLoading(false);
    }
  };

  const handleDeletePlan = async (planId) => {
    if (!window.confirm('Are you sure you want to delete this subscription plan?')) {
      return;
    }

    try {
      setLoading(true);
      const response = await ApiService.deleteSubscriptionPlan(planId);

      // If we get here without throwing, it was successful
      setSuccess('Subscription plan deleted successfully!');
      fetchSubscriptionPlans();
      fetchSubscriptionStats();

      // Auto-dismiss success message
      setTimeout(() => setSuccess(''), 3000);
    } catch (error) {
      setError(error.message || 'Failed to delete subscription plan');
      // Auto-dismiss error message
      setTimeout(() => setError(''), 5000);
    } finally {
      setLoading(false);
    }
  };

  // Modal handlers
  const openCreateModal = () => {
    resetForm();
    setShowCreateModal(true);
  };

  const openEditModal = (plan) => {
    setSelectedPlan(plan);
    setPlanForm({
      name: plan.name || '',
      slug: plan.slug || '',
      description: plan.description || '',
      monthly_price: plan.monthly_price || '',
      yearly_price: plan.yearly_price || '',
      setup_fee: plan.setup_fee || '',
      max_properties: plan.max_properties || '',
      max_images_per_property: plan.max_images_per_property || '',
      analytics_enabled: plan.analytics_enabled || false,
      priority_support: plan.priority_support || false,
      api_access: plan.api_access || false,
      custom_branding: plan.custom_branding || false,
      advanced_reporting: plan.advanced_reporting || false,
      is_active: plan.is_active !== false,
      is_featured: plan.is_featured || false,
      sort_order: plan.sort_order || 0,
      trial_days: plan.trial_days || 0
    });
    setShowEditModal(true);
  };

  const openFeaturesModal = (plan) => {
    setSelectedPlan(plan);
    setPlanForm({
      name: plan.name || '',
      slug: plan.slug || '',
      description: plan.description || '',
      monthly_price: plan.monthly_price || '',
      yearly_price: plan.yearly_price || '',
      setup_fee: plan.setup_fee || '',
      max_properties: plan.max_properties || '',
      max_images_per_property: plan.max_images_per_property || '',
      analytics_enabled: plan.analytics_enabled || false,
      priority_support: plan.priority_support || false,
      api_access: plan.api_access || false,
      custom_branding: plan.custom_branding || false,
      advanced_reporting: plan.advanced_reporting || false,
      is_active: plan.is_active !== false,
      is_featured: plan.is_featured || false,
      sort_order: plan.sort_order || 0,
      trial_days: plan.trial_days || 0
    });
    setShowFeaturesModal(true);
  };

  const openAddBillingModal = () => {
    resetBillingForm();
    setShowAddBillingModal(true);
  };

  const handleUpdateFeatures = async (e) => {
    e.preventDefault();
    try {
      setLoading(true);
      setError('');

      const featuresData = {
        analytics_enabled: planForm.analytics_enabled,
        priority_support: planForm.priority_support,
        api_access: planForm.api_access,
        custom_branding: planForm.custom_branding,
        advanced_reporting: planForm.advanced_reporting,
        max_properties: planForm.max_properties,
        max_images_per_property: planForm.max_images_per_property
      };

      const response = await ApiService.updateSubscriptionPlanFeatures(selectedPlan.id, featuresData);

      // If we get here without throwing, it was successful
      setSuccess('Plan features updated successfully!');
      setShowFeaturesModal(false);
      resetForm();
      fetchSubscriptionPlans();

      // Auto-dismiss success message
      setTimeout(() => setSuccess(''), 3000);
    } catch (error) {
      setError(error.message || 'Failed to update plan features');
      // Auto-dismiss error message
      setTimeout(() => setError(''), 5000);
    } finally {
      setLoading(false);
    }
  };

  const revenueData = [
    { month: 'Jan', basic: 0, pro: 0, enterprise: 0 },
    { month: 'Feb', basic: 0, pro: 0, enterprise: 0 },
    { month: 'Mar', basic: 0, pro: 0, enterprise: 0 },
    { month: 'Apr', basic: 0, pro: 0, enterprise: 0 },
    { month: 'May', basic: 0, pro: 0, enterprise: 0 },
    { month: 'Jun', basic: 0, pro: 0, enterprise: 0 }
  ];

  const renderOverview = () => (
    <div className="space-y-8">
      {/* Stats Grid */}
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        {subscriptionStats.map((stat, index) => (
          <div key={index} className="bg-white rounded-xl shadow-sm border-2 border-black p-6">
            <div className="flex items-center justify-between">
              <div>
                <p className="text-sm font-medium text-gray-800">{stat.title}</p>
                <p className={`text-2xl font-bold ${stat.color} mt-1`}>{stat.value}</p>
              </div>
              <div className="text-3xl">{stat.icon}</div>
            </div>
            <div className="mt-4">
              <span className={`text-sm font-medium ${
                stat.change.startsWith('+') ? 'text-black' : 'text-gray-600'
              }`}>
                {stat.change}
              </span>
              <span className="text-sm text-gray-600 ml-1">from last month</span>
            </div>
          </div>
        ))}
      </div>

      {/* Plan Performance */}
      <div className="bg-white rounded-2xl shadow-sm border-2 border-black p-6">
        <h3 className="text-xl font-semibold text-black mb-6">Plan Performance</h3>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
          {subscriptionPlans.length === 0 && !loading ? (
            <div className="col-span-3 text-center py-8">
              <p className="text-gray-600 mb-4">No subscription plans found.</p>
              <button 
                onClick={openCreateModal}
                className="bg-black text-white px-4 py-2 rounded-lg hover:bg-gray-800 transition-colors"
              >
                Create Your First Plan
              </button>
            </div>
          ) : (
            subscriptionPlans.map((plan) => {
            const features = [];
            if (plan.max_properties) features.push(`Up to ${plan.max_properties === -1 ? 'unlimited' : plan.max_properties} properties`);
            if (plan.analytics_enabled) features.push('Advanced Analytics');
            if (plan.priority_support) features.push('Priority Support');
            if (plan.api_access) features.push('API Access');
            if (plan.custom_branding) features.push('Custom Branding');
            if (plan.advanced_reporting) features.push('Advanced Reporting');

            return (
              <div key={plan.id} className="border-2 border-black rounded-xl p-6">
                <div className="text-center mb-4">
                  <h4 className="text-lg font-semibold text-black mb-2">{plan.name}</h4>
                  <div className="text-2xl font-bold text-black mb-1">â‚±{parseFloat(plan.monthly_price || 0).toLocaleString()}</div>
